import styled from 'styled-components'

export const Wrapper = styled.div`
  padding: 2.4em 2em;

  display: flex;
  flex-wrap: wrap;
  flex-direction: column;
  align-items: center;

  box-shadow: 0 2.778rem 4.944rem 0 rgba(0, 6, 70, 0.03);
`

export const Img = styled.img`
  width: 50%;
  height: auto;
`
